import React,{Component} from 'react';
import {ListComponent} from './styles/List.style';
import {strings} from '../utils/strings';

class List extends Component {
  render(){
  return (
    <ListComponent>
      {this.props.list && this.props.list.length && this.props.list.map((item,index)=>{
        var  isOpen =  item.opening_hours && item.opening_hours.open_now;
        return(
          <div key={item.id} className="list-container">
          <div class="list-image" style={{backgroundImage: `url(${item.photos && item.photos.length?item.photos[0].getUrl():''})`}} />
          <div className="list-details">
            <h4>{item.name}</h4>
            <span className="address">{item.vicinity}</span>
            <span class="time">{isOpen ? 'Open' : 'Closed'}</span>
            {/* <span class="getDirection--link">{item.opening_hours.isOpen()}</span> */}
          </div>
          </div>
        );
      })}
    </ListComponent>
    );
  }
}
export default List;
